import styled from 'styled-components';
import Navbar from './components/navbar';
import { BrowserRouter, Route, Routes, Link} from 'react-router-dom'
let AppWrapper = styled.div`

width:100%;
min-heigth:100vh;
`

function App() {
  return (

<AppWrapper>
 <BrowserRouter>
  <Navbar/>
  <Routes>
  <Route path='/'/>
  <Route path='/register'/>
  <Route path='login'/>
  </Routes>
  </BrowserRouter>
</AppWrapper>
  );
}

export default App;
